// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import UserList from './UserList';
import UserForm from './UserForm';
import './App.css';

function App() {
    return (
        <Router>
            <div className="App">
                <Routes>
                    <Route path="/" element={
                        <div className="home">
                            <h1>Seleccione una empresa</h1>
                            <div className="button-container">
                                <Link to="/kallpa/lista" className="button kallpa-button">
                                    Kallpa
                                </Link>
                                <Link to="/energy/lista" className="button energy-button">
                                    Energy
                                </Link>
                            </div>
                        </div>
                    } />
                    <Route path="/kallpa/lista" element={<UserList company="kallpa" />} />
                    <Route path="/kallpa/registro" element={<UserForm company="kallpa" />} />
                    <Route path="/energy/lista" element={<UserList company="energy" />} />
                    <Route path="/energy/registro" element={<UserForm company="energy" />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
